import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ContactUs from './components/ContactUs'



function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ContactUs/>}/>     
      </Routes>
    </Router>
  );
}

export default App;
